import React from "react";
import Footer from "./Footer";

function App() {
  return (
    <div>
      <nav>
        <h1>My Ugly Little To Do List</h1>
        <ul>
          <li>Pinterest Healthy Dinner Recipes</li>
          <li>Study React</li>
          <li>Plan outfit for tomorrow</li>
          <li>Catch up on The Bachelorette</li>
        </ul>
      </nav>
      <main>
        <p>
          If you don't love yourself, how in the hell are you going to love
          somebody else?
        </p>
        <p>Can I get an Amen?</p>
      </main>
    </div>
  );
}

export default App;
